import React from 'react';


const Navigation = ({loggedIn, currentRoute}) => {
	if(loggedIn){
		return(
		<div className="f3 fw6 tr">
		   <p 
		   className="underline link dim black pa3 pointer"
		   onClick = {() => currentRoute(false)}> Sign out </p>
		</div>
		   );
		} else {
          return(
          	<div>
             <p
		     className="underline link dim black pa3 pointer"
		     onClick = {() => currentRoute('register')}> Register? </p>
		     <p
		     className="underline link dim black pa3 pointer"
		     onClick = {() => currentRoute(false)}> Sign In? </p>
            </div>
          	);
		}
};

export default Navigation;
